# Inheritance in Java

Inheritance is a fundamental concept in object-oriented programming (OOP) that allows one class to inherit the properties and behavior of another class. The inheriting class is called the subclass or derived class, and the class being inherited from is called the superclass or base class.

## Basic Syntax

The basic syntax for inheritance in Java is as follows:
```java
public class SuperClass {
    // properties and methods
}

public class SubClass extends SuperClass {
    // properties and methods
}
```
In this example, `SubClass` inherits all the properties and methods of `SuperClass`.

## Types of Inheritance

Java supports two types of inheritance:

1. **Single Inheritance**: A subclass can inherit from only one superclass.
2. **Multiple Inheritance**: A subclass can inherit from multiple superclasses using interfaces.

## Access Modifiers

In Java, access modifiers can be used to control access to the properties and methods of a superclass from a subclass. The access modifiers are:

* `public`: accessible from anywhere
* `protected`: accessible from the subclass and its subclasses
* `default` (no modifier): accessible from the same package
* `private`: accessible only within the same class

## Example

Here's an example of inheritance in Java:
```java
public class Animal {
    public void eat() {
        System.out.println("Eating...");
    }
}

public class Dog extends Animal {
    public void bark() {
        System.out.println("Barking...");
    }
}

public class Main {
    public static void main(String[] args) {
        Dog dog = new Dog();
        dog.eat(); // Output: Eating...
        dog.bark(); // Output: Barking...
    }
}
```
In this example, `Dog` inherits the `eat()` method from `Animal` and adds its own `bark()` method.

## Inheritance Hierarchy

In Java, a subclass can inherit from a superclass, which can itself inherit from another superclass, and so on. This creates an inheritance hierarchy.

## Overriding and Overloading

In Java, a subclass can override a method of its superclass or overload a method with the same name but different parameters.

* **Method Overriding**: a subclass provides a different implementation of a method that is already defined in its superclass.
* **Method Overloading**: a subclass provides multiple implementations of a method with the same name but different parameters.

